import React from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import "../App.css";

import { Pagination, Navigation } from 'swiper/modules';
import Card from './Card';
import { Autoplay, Scrollbar } from 'swiper/modules';

const MySwiper = () => {
    const slides = [
        {
          imageUrl: 'https://via.placeholder.com/800x400?text=Slide+1',
          caption: 'Slide 1 Caption',
        },
        {
          imageUrl: 'https://via.placeholder.com/800x400?text=Slide+2',
          caption: 'Slide 2 Caption',
        },
        {
          imageUrl: 'https://via.placeholder.com/800x400?text=Slide+3',
          caption: 'Slide 3 Caption',
        },
        {
          imageUrl: 'https://via.placeholder.com/800x400?text=Slide+4',
          caption: 'Slide 4 Caption',
        },
      ];
  return (
    <Swiper
    spaceBetween={30}
    slidesPerView={1}
    loop={true}
    pagination={{ clickable: true }}
    navigation={true}
    modules={[Pagination, Navigation, Autoplay, Scrollbar]}
    autoplay={{ delay: 3000 }}
    scrollbar={{ draggable: true }}
  >
      <SwiperSlide> <Card text={<><img width={"100%"}  /><h1 style={{ fontSize: 14, textAlign: "center", color: "black" }}>
      Bank Statement Reconciliation</h1> <br /></>} /></SwiperSlide>
      <SwiperSlide><Card text={<><img width={"100%"}  /><h1 style={{ fontSize: 14, textAlign: "center", color: "black" }}>
      Bank Statement Reconciliation</h1> <br /></>} /></SwiperSlide>
      <SwiperSlide><Card text={<><img width={"100%"}  /><h1 style={{ fontSize: 14, textAlign: "center", color: "black" }}>
      Bank Statement Reconciliation</h1> <br /></>} /></SwiperSlide>
      <SwiperSlide><Card text={<><img width={"100%"}  /><h1 style={{ fontSize: 14, textAlign: "center", color: "black" }}>
      Bank Statement Reconciliation</h1> <br /></>} /></SwiperSlide>
      {/* Add more slides here */}
    </Swiper>
  );
};

export default MySwiper;
